&nbsp;<span style="font-size: medium; "><strong>According to your age, list down the number of things that most people don&rsquo;t know about you. And then tag 5 people.</strong></span><p class="MsoNormal" style="background:white"><span style="font-size:10.0pt;font-family:Verdana;mso-bidi-font-family:Arial;
color:black;mso-bidi-font-weight:bold"> <br /> <span class="apple-style-span">1. I was born a week late. And the doctors had to induce labour in my mum to get me out.&nbsp;<br /><br /></span></span><span style="font-size:9.0pt;font-family:Arial;color:black"><o:p></o:p></span><span class="apple-style-span"><span style="font-size:10.0pt;
font-family:Verdana;color:black;mso-bidi-font-weight:bold">2. I got stuck on the way out and needed to be pulled out by forceps.<br /></span></span><span style="font-size:10.0pt;font-family:Verdana;color:black;mso-bidi-font-weight:
bold"><br /> <span class="apple-style-span">3. The first time I remember crying because I was sad was when I was eight, my great-grandma had just passed away.<br /><br />4. You can barely walk from my door to my bed without stepping on something.<br /><br /></span></span><span class="apple-style-span"><span style="font-size:10.0pt;font-family:Verdana;mso-bidi-font-family:Arial;
color:black;mso-bidi-font-weight:bold">5. (reason) I don't like neatness, except where words are involved or on the computer. I have clothes and stacks of books and papers in all the wrong places in my room.<br /><br /></span></span><span style="font-size:10.0pt;font-family:Verdana;mso-bidi-font-family:Arial;
color:black;mso-bidi-font-weight:bold">6. I have a very strong desire to shave my head and/or to give blood.<br /><br />7. The only tattoo I've ever considered getting is &quot;hair for hope&quot; on the back of my head.<br /><br />8. I am drawn to caucasian children.<br /><br />9. I can't hold a tune to save my life.<br /><br />10. I sometimes make people angry intentionally.<br /><br />11. I haven't outgrown fastfood like everyone else has. ): Subway, Carl's Jr., McDonalds and Burger King are still big parts of my life.<br /><br />12. This one's important: I haven't had a alcoholic beverage since Feb '08 and am extremely proud of myself for that.<br /><br />13. I try to bring at least one of my stuffed animals when I go overseas. My favourites are Ali bear (from godpa) and TipTop the giraffe.<br /><br />14. I have saved 200bucks in 1.5 months. ((:<br /><br />15. I've recognised my love for children since I was nine.<br /><br />16. I am a procrastinator. Ha, you already knew that. There is no way I can do my work if no one pressurizes me to finish it.<br /><br />17. I really enjoyed acting at age 6-8. And still talk about my &quot;yellow skirt&quot; experience frequently, because even though it was one of my most embarassing moments, I'm proud that I ever performed for so many people.<br /><br />18. I often dream of running away from my life in SG and starting over somewhere else.<br /><br type="_moz" /> </span><strong><span class="apple-style-span"><span style="font-size:10.0pt;font-family:
